import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [newPhone, setNewPhone] = useState({
    name: '',
    number: '',
    department: '',
    area: '',
  });

  const [departments, setDepartments] = useState([]);
  const [areas, setAreas] = useState([]);

  useEffect(() => {
    fetchDepartments();
    fetchAreas();
  }, []);

  const fetchDepartments = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/departments');
      setDepartments(res.data);
    } catch (err) {
      console.error('Lỗi fetch departments', err);
    }
  };

  const fetchAreas = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/areas');
      setAreas(res.data);
    } catch (err) {
      console.error('Lỗi fetch areas', err);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewPhone({ ...newPhone, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/phones', newPhone, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      setNewPhone({
        name: '',
        number: '',
        department: '',
        area: '',
      });
      alert('Thêm số điện thoại thành công!');
    } catch (err) {
      console.error('Lỗi thêm số điện thoại', err);
    }
  };

  return (
    <div className="container py-5">
      <h2 className="text-center mb-4">Dashboard - Quản lý số điện thoại</h2>

      {/* Thêm số điện thoại */}
      <div className="card shadow-lg p-4 mb-4">
        <h4>Thêm số điện thoại mới</h4>
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Tên người sử dụng</label>
            <input
              type="text"
              className="form-control"
              name="name"
              value={newPhone.name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Số điện thoại</label>
            <input
              type="text"
              className="form-control"
              name="number"
              value={newPhone.number}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label className="form-label">Bộ phận</label>
            <select
              className="form-select"
              name="department"
              value={newPhone.department}
              onChange={handleChange}
              required
            >
              <option value="">Chọn bộ phận</option>
              {departments.map((dept) => (
                <option key={dept.id} value={dept.name}>
                  {dept.name}
                </option>
              ))}
            </select>
          </div>
          <div className="mb-3">
            <label className="form-label">Khu vực</label>
            <select
              className="form-select"
              name="area"
              value={newPhone.area}
              onChange={handleChange}
              required
            >
              <option value="">Chọn khu vực</option>
              {areas.map((area) => (
                <option key={area.id} value={area.name}>
                  {area.name}
                </option>
              ))}
            </select>
          </div>
          <button type="submit" className="btn btn-success">Thêm</button>
        </form>
      </div>

      {/* Quản lý Bộ phận và Khu vực */}
      <div className="card shadow-lg p-4">
        <h4>Quản lý Bộ phận và Khu vực</h4>
        <div className="row">
          {/* Bộ phận */}
          <div className="col-md-6">
            <h5>Bộ phận</h5>
            {/* Bạn có thể hiển thị bảng Bộ phận và các nút Sửa, Xóa ở đây */}
          </div>

          {/* Khu vực */}
          <div className="col-md-6">
            <h5>Khu vực</h5>
            {/* Bạn có thể hiển thị bảng Khu vực và các nút Sửa, Xóa ở đây */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
